  return (
    <div className={style.mainContainer}>
      <button onClick={props.onClose} className={style.boton}>x</button>
      <h1>{props.name}</h1>
      <h4> Max </h4>
      <p>{props.max}</p>
      <h4> Min </h4>
      <p>{props.min}</p>
      <div className={style.imgContainer}>
      <img 
        src={`http://openweathermap.org/img/wn/${props.img}@2x.png`}
        alt="clima"
      />
      </div>
    </div>
  );
}
